package com.wsc2018091702;

public class car {
	public int id;
	public String name;

	public car(int id, String name) {
		super();
		this.id = id;
		this.name = name;
	}

	public car() {
		super();
		// TODO Auto-generated constructor stub
	}

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

}
